function addToOutput(list,output) {
    for(var i = 0; i < list.length; i++) {
        var record = list[i];

        var typeMap = output[record.Type];
        if(!typeMap) {
            typeMap = {};
            output[record.Type] = typeMap;
        }

        typeMap[record.Id] = record;
    }
}

