var output = {};

var byName = {};
var byId = {}

var fileTypeRecordList = fileEntryDownload.data.Response;
for(var i = 0; i < fileTypeRecordList.length; i++) {
    var record = fileTypeRecordList[i];
    byName[record.Fields.file_type_name] = record.Id;
    byId[record.Id] = record.Fields.file_type_name;
}

output.byName = byName;
output.byId = byId;

return output;

//see the notes for a full function description

//get the lookup keys
var lookupString = getEntryString(fileType,section,entryValue);
var normalizedBodyString = getFileEntryRefString(entryData);
var result;

var fileEntryMap;
var entryList

//search the data
for(var i = 0; i < fileEntryMapList.length; i++) {
    fileEntryMap = fileEntryMapList[i];
    entryList = fileEntryMap[lookupString];
    if(entryList) {
        result = entryList.find( (entry) => entry.refString == normalizedBodyString);
        if(result) return result;
    }
}

//this is to highlight we want to use the LAST file entry map
var lastFileEntryMap = fileEntryMap;
var lastEntryList = entryList;

//add a new wrapper to the last list, with an empty entry, if the flag is set
if(createPlaceHolder) {
    //creat wrapper with the ref string, butno file entry
    result = {};
    result.refString = normalizedBodyString;
    //put it in the entry list from the LAST file entry map
    if(!lastEntryList) {
        lastEntryList = [];
        lastFileEntryMap[lookupString] = lastEntryList;
    }
    lastEntryList.push(result);
    return result;
}
else {
    return undefined;
}

var output = {};

var fileEntryDownloadList = fileEntryDownload.data.Records;
for(var i = 0; i < fileEntryDownloadList.length; i++) {
    var record = fileEntryDownloadList[i];
    if(record.Type == "file_entry") {
        var lookupKey = getEntryStringFromRecord(record);
        var entryList = output[lookupKey];
        if(!entryList) {
            entryList = [];
            output[lookupKey] = entryList;
        }

        refString = getFileEntryRefString(record.Fields.entry_data);
        var recordEntry = {
            "fileEntry":record,
            "refString": refString
        };
        entryList.push(recordEntry);
    }
}

return output;

