    var fileType = getFileTypeName(fileEntryRecord.Fields.file_type_id);
    var section = fileEntryRecord.Fields.entry_section;
    var entryKey = fileEntryRecord.Fields.entry_key;

    return getEntryString(fileType,section,entryKey);
}

