var recordInfo = getRecordInfo(createRecord.Type);

var instruction = {};
instruction.Type = "Create";
instruction.Record = recordInfo.name;
instruction.Id = createRecord.Id;

instruction.targetReadPerm = createRecord.read_perm;
instruction.targetEditPerm = createRecord.edit_perm;

var targetData = {};
instruction.Target = targetData;

for(var i = 0; i < recordInfo.fields.length; i++) {
    var field = recordInfo.fields[i];
    var targetValue;
    var targetValue = createRecord.Fields[field.name];
    if(targetValue === undefined) {
        //use default
        targetValue = field.defaultValue;
    }

    if(targetValue === undefined) {
        throw new Error("Unknown problem: undefined field value: " + getFieldErrString(createRecord,field));
    }

    if(targetValue === null) {
        if(!field.nullOk) {
            throw new Error("Illegal null value: " + getFieldErrString(createRecord,field));
        }
    }

    targetData[field.name] = targetValue;
}

return instruction;

var recordInfo = getRecordInfo(deleteRecord.Type);

var instruction = {};
instruction.Type = "Delete";
instruction.Record = recordInfo.name;
instruction.Id = deleteRecord.Id;

instruction.initialReadPerm = deleteRecord.read_perm;
instruction.initialEditPerm = deleteRecord.edit_perm;

var initialData = {};
instruction.Initial = initialData;

for(var i = 0; i < recordInfo.fields.length; i++) {
    var field = recordInfo.fields[i];
    var initialValue = deleteRecord.Fields[field.name];

    initialData[field.name] = initialValue;
}

return instruction;

var recordInfo = dataSetInfo.records[recordType];

if(!recordInfo) {
    throw new Error("Record type not found in getRecordInfo: " + recordType);
}

return recordInfo;

var output = [];
for(var key in combinedEntries) {
    var entry = combinedEntries[key];
    var instruction = getInstructionForCombinedEntry(entry);
    if(instruction) {
        output.push(instruction);
    }
}

return output;

updateData.supplementalCode:
function getInstructionForCombinedEntry(combinedEntry) {
    var newEntry = combinedEntry.newEntry;
    var oldEntry = combinedEntry.oldEntry;

    if(newEntry) {
        if(!oldEntry) {
            console.log("Create: " + newEntry.Id);
            return createCreateInstruction(newEntry);
        }
        else {
            //this will return null for matching records
            console.log("Update(maybe): " + newEntry.Id);
            return createUpdateInstruction(oldEntry,newEntry);
        }
    }
    else if(oldEntry) {
        console.log("Delete: " + oldEntry.Id);
        return createDeleteInstruction(oldEntry);
    }

    return null;
}

function entriesDifferent(entry1,entry2) {
    var string1 = JSON.stringify(apogee.util.getNormalizedCopy(entry1));
    var string2 = JSON.stringify(apogee.util.getNormalizedCopy(entry2));
    return (string1 == string2);
}

