function getPresetsObjectRef(props) {
    //I am assuming these are in order and that they give a single object
    var objectRef = {};
    objectRef.file = "presets";
    objectRef.section = ["property_trees","geometry"];

    var path = ["geom_type"]; //assume they are all under geom type
    for(var key in props) {
        path.push(key);
        path.push(props[key]);
    }
    objectRef.path = path;

    return objectRef;
}

function createKey(props) {
    var entryKey = "";
    for(var propKey in props) {
        if(entryKey.length > 0) entryKey += ":";
        entryKey += propKey + ":" + props[propKey];
    }
    return entryKey;
}

