function getPropTreeEntry(inEntry) {
    var outEntry;

    if(inEntry.tree != "geometry") {
        throw new Error("Unsupported presets tree: " + inEntry.tree);
    }

    switch(inEntry.path.length) {
        case 0:
            //don't add this one! bad data!
            outEntry = null;
            break;

        case 1:
            outEntry = getPath1Entry(inEntry);
            break;

        case 2:
            outEntry = getPath2Entry(inEntry);
            break;

        case 3:
            outEntry = getPath3Entry(inEntry);
            break;

        default:
            throw new Error("Unsupported path length in preset override!");
    }

    return outEntry;
}

function getPath1Entry(inEntry) {

    //make sure this is empty
    if(!isEmpty(inEntry.entry)) {
        throw new Error("Non empty child entry: " + inEntry.value);
    }

    var legacyKey = inEntry.path[0];
    var legacyValue = inEntry.value;

    var extendedType = getExtendedType(legacyKey,legacyValue);
    if(!extendedType) throw new Error("Path 1 extended type not found - " + legacyKey + ":" + legacyValue);

    //this is a new type
    var key = legacyKey + ":" + legacyValue;

    var featureTypeName = (legacyKey == "facility") ? "facility " + legacyValue : legacyValue;

    var entryData = {};
    entryData.extends = extendedType;
    entryData.name = key + " (Standard)";
    entryData.properties = [];

    var propEntry = {};
    propEntry.key = "featureType";
    propEntry.action = "modifies"
    propEntry.value = featureTypeName;
    propEntry.legacyKey = legacyKey;
    propEntry.legacyValue = legacyValue;

    entryData.properties.push(propEntry);

    var outEntry = {};
    outEntry.fileType = "propertyRules";
    outEntry.entry_section = "geometry";
    outEntry.entry_key = key;
    outEntry.entry_data = entryData;
    outEntry.nameBase = key;
    return outEntry;
}

function getPath2Entry(inEntry) {

    //we have child entries here!!!

    var legacyKey = inEntry.path[0];
    var legacyValue = inEntry.path[1];

    var inData = inEntry.entry;
    var childKey = inData.k;
    var inChildValueMap = inData.v;

    if(inData.input != "enum") {
        throw new Error("Path 2 expected child key type 'enum', found " + inData.input);
    }

    //this is like "use" for room or unit
    var baseTypeName = legacyKey + ":" + legacyValue + "(Standard)";
    var key = baseTypeName + " insert " + childKey; 

    var entryData = {};
    entryData.modifies = baseTypeName;
    entryData.name = key + " (Standard)";
    entryData.properties = [];

    var propEntry = {};
    propEntry.key = childKey;
    propEntry.type = "enum"
    propEntry.values = [];
    for(var childValue in inChildValueMap) {
        propEntry.values.push({"value":childValue});
    }

    entryData.properties.push(propEntry);

    var outEntry = {};
    outEntry.fileType = "propertyRules";
    outEntry.entry_section = "geometry";
    outEntry.entry_key = key;
    outEntry.nameBase = key;
    outEntry.entry_data = entryData;

    return outEntry;
}

function getPath3Entry(inEntry) {

    //make sure this is empty
    if(!isEmpty(inEntry.entry)) {
        throw new Error("Non empty child entry: " + inEntry.value);
    }

    var legacyKey = inEntry.path[0];
    var legacyValue = inEntry.path[1];
    var childKey = inEntry.path[2];
    var childValue = inEntry.value;

    if(legacyKey != "facility") {
        throw new Error("Path 3 expected legacy key 'facility', found: " + legacyKey);
    }
    if((legacyValue != "room")&&(legacyValue != "unit")) {
        throw new Error("Path 3 expected legacy value 'room' or 'unit', found: " + legacyValue);
    }
    if(childKey != "use") {
        throw new Error("Path 3 expected child key 'use', found: " + childKey);
    }

    //this is "use" for room or unit
    var baseTypeName = legacyKey + ":" + legacyValue + " (Standard)";
    var key = baseTypeName + " insert " + childKey + ":" + childValue;

    var entryData = {};
    entryData.modifies = baseTypeName;
    entryData.name = key + " (Standard)";
    entryData.properties = [];

    var propEntry = {};
    propEntry.key = childKey;
    propEntry.action = "modifies"
    propEntry.values = [];
    propEntry.values.push({"value":childValue});

    entryData.properties.push(propEntry);

    var outEntry = {};
    outEntry.fileType = "propertyRules";
    outEntry.entry_section = "geometry";
    outEntry.entry_key = key;
    outEntry.nameBase = key;
    outEntry.entry_data = entryData;

    return outEntry;
}


function getNamedKeyEntry(inEntry) {

    //make sure this is empty
    if(!isEmpty(inEntry.entry)) {
        throw new Error("Non empty child entry: " + inEntry.value);
    }

    if(inEntry.name != "address keys") {
        throw new Error("Only address key named entries processed, found: " + inEntry.name);
    }

    //this is "use" for room or unit
    var addressKey = inEntry.value;
    var key = "address keys insert: " + addressKey;

    var entryData = {};
    entryData.modifies = "address keys (Standard)";
    //for these entries, we require the option name is standard!
    entryData.name = key + " (Standard)";
    entryData.properties = [];

    var propEntry = {};
    propEntry.key = "address keys";
    propEntry.action = "modifies"
    propEntry.values = [];
    propEntry.values.push({"value":addressKey});

    entryData.properties.push(propEntry);

    var outEntry = {};
    outEntry.fileType = "propertyRules";
    outEntry.entry_section = "named_entries";
    outEntry.entry_key = key;
    outEntry.nameBase = key;
    outEntry.entry_data = entryData;

    return outEntry;
}

function getExtendedType(legacyKey,legacyValue) {
    if(legacyKey == "facility") {
        return presetsOverridesFacilityExtends[legacyValue];
    }
    else {
        return presetsOverridesExtends[legacyKey];
    }
}


function isEmpty(object) {
    for(var key in object) {
        return false;
    }
    return true;
}

