function createMetaFileRecord(fileType,fileContext,fileName) {
    var metaFields = {};
    metaFields.file_type_id = data.getFileTypeId(fileType);
    metaFields.file_context = fileContext;
    metaFields.name = fileName;

    return micemetarDataAccess.createRecord("meta_file",metaFields);
}

function getFileEntryIdList(fileType,prelimEntries,workingFileEntryMap) {
    return prelimEntries.map((entry) => getFileEntryId(fileType,entry,workingFileEntryMap) );
}

function getFileEntryId(fileType,prelimEntry,workingFileEntryMap) {
    var section = prelimEntry.entry_section;
    var entryKey = prelimEntry.entry_key;
    var entryData = prelimEntry.entry_data
    var createPlaceHolder = true;
    var fileEntryMapList = [data.dbFileEntryMap,workingFileEntryMap];

    var fileEntryWrapper = data.lookupFileEntry(fileType,section,entryKey,entryData,createPlaceHolder,fileEntryMapList);

    if(!fileEntryWrapper.fileEntry) {
        //we need to create a new file entry!
        fileEntryWrapper.fileEntry = createFileEntry(fileType,prelimEntry,createSettings.entryContext,createSettings.entryOptionName);

console.log("File entry created: " + fileEntryWrapper.fileEntry.Id);        

    }

    return fileEntryWrapper.fileEntry.Id;
}

function createFileEntry(fileType,prelimEntry,entryContext,entryOptionName) {

    //we are assuming the option name for a property rules entry is "Standard", otherwise
    //the entry data is incorrect. Verify this is true.
    if((fileType == "propertyRules")&&(entryOptionName != "Standard")) {
        throw new Error("This code does not work is a property rules entry name is not Standard: " + prelimEntry.entry_key);
    }

    var fields = {};
    fields.file_type_id = data.getFileTypeId(fileType);
    fields.entry_context = entryContext;
    fields.entry_section = prelimEntry.entry_section;
    fields.entry_key = prelimEntry.entry_key;
    fields.entry_name = prelimEntry.nameBase + " (" + entryOptionName + ")";
    fields.entry_data = prelimEntry.entry_data;
    fields.option_name = entryOptionName;

    return micemetarDataAccess.createRecord("file_entry",fields);
}

function createRecipeRecords(metaFileId,fileEntryIds,prelimEntries) {
    return fileEntryIds.map( (fileEntryId,index) => createRecipeRecord(metaFileId,fileEntryId,prelimEntries[index]));
}

function createRecipeRecord(metaFileId,fileEntryId,prelimEntry) {
    var fields = {};
    fields.meta_file_id = metaFileId;
    fields.file_entry_id = fileEntryId;

    var insertionInfo = prelimEntry.insertion_info;
    if(insertionInfo) {
        fields.insertion_info = insertionInfo;
    }

    return micemetarDataAccess.createRecord("recipe_entry",fields);
}

function createParentMetaRecords(metaFileId,fileType) {

    var baseFileList = baseFileIdByFileType[fileType];

    var records = [];

    var baseFileToParentMetaEntry = baseFileId => {
        var fields = {};
        fields.meta_file_id = metaFileId;
        fields.parent_file_id = baseFileId
        fields.relation = "overrides";

        return micemetarDataAccess.createRecord("meta_parent_entry",fields);
    }

    return baseFileList.map(baseFileToParentMetaEntry);

}

function getFileContext(url) {
    var urlFieldList = url.split("/");
    var index;

    //try customer
    index = urlFieldList.indexOf("customer");
    if(index >= 0) {
        var name = urlFieldList[index+1];
        var context = urlNamesToContext[name];
        if(context === undefined) {
            throw new Error("Name missing from context lookup table: " + name);
        }
        return context;
    }

    //assume cid
    index = urlFieldList.indexOf("map");
    if(index >= 0) {
        return "com_" + urlFieldList[index+1];
    }

    //should get here
    throw new Error("Error getting context from URL: " + url);

}

