var output = {};
output.nm = metaFileRecord.Fields.name;
output.data = {};

var isRecipeEntry = entry => entry.Type == "recipe_entry";
var addToOutput = recipeEntry => processEntry(output,metaFileRecord,recipeEntry,fileEntry);

supportingRecordList.filter(isRecipeEntry).map(addToOutput);

