this.messageInput = null;
this.submitButton = null;
this.cancelButton = null;
this.initialized = false;

this.onSubmit = function() {

    if(!this.initialized) {
        return;
    }

    var commitMessage = this.messageInput.value.trim();
    if((!commitMessage)||(commitMessage.length === 0)) {
        alert("You must enter a commit message!");
        return;
    }
    this.messageInput.value = "";

    if((!this.instructionList)||(this.instructionList.length === 0)) {
        alert("There is no data to commit.");
        return;
    }

    var updateInfo = [];
    updateInfo.push([ "commitMessage",commitMessage]);
    updateInfo.push(["liveInstructionList",this.instructionList]);
    mode.getMessenger().compoundDataUpdate(updateInfo,true);
}

this.onCancel = function() {
    mode.getMessenger().dataUpdate("taskResults.editMetaFile","");
}

